func lengthOfLongestSubstring(s string) int {

	//最大长度
	maxLen := 0
	//临时串
	tmpStr := s

	if len(s) == 0 || len(s) == 1 {
		return len(s)
	}

	var flag int
	var length int

	for {
		//获取当前串的首个无重复字符的子串长度，以及标志位
		flag, length = lengthOfFirstNoRepeatCharSubstring(tmpStr, length-flag)
		if maxLen < length {
			maxLen = length
		}

		//判断是否已经遍历完原字符串
		if flag == -2 {
			break
		}else {
			tmpStr = subStr(tmpStr, flag + 1, len(tmpStr))
		}
	}

	return  maxLen
}

//获取当前字符串首个无重复字符的子串长度
func lengthOfFirstNoRepeatCharSubstring(s string, nextIndex int) (int, int) {

	//计算器
	count := nextIndex

	//递归出口，串只剩下一个字符
	if (len(s) == 1) {
		return -2, count
	}

	for i := nextIndex; i < len(s); i++ {

		//字符返回当前位置索引
		index := strings.Index(subStr(s, 0, i), string(s[i]))

		if index == -1 {
			//增加计数
			count++

		}else {

			return index, count
		}
	}

	return -2, count
}

//获取字符串的某一段
func subStr(str string, start, end int) string {
	//要获取每一个字符，需要转换成rune切片
	runeStr := []rune(str)
	//计算字符串长度
	runeLen := len(runeStr)

	if start < 0 || start > runeLen {
		panic("start is wrong")
	}

	if end < 0 || end > runeLen {
		panic("end is wrong")
	}

	return string(runeStr[start:end])

}